My non-negotiable morning routine that sets me up for success ☺️🤞🏼

My mornings are superrrr important to me. I’m definitely a people person but having the first hour of my day at least to myself is key for me to be a happy Squirrel 🐿️ 

Some of my go-tos:

@akashasuperfoods sea moss gel (kickstarts my digestion and makes me feel amazing!)

@gochirp wheel for back pain relief

@nipandfab gel eye patches (love keeping these in the fridge)

@willas_kitchen oat milk & cold brew (coffee is my favorite part of the morning and I like to use milks that are gum-free and with simple ingredients)

@strausmilk chocolate shell protein yogurt bowl topped w/ @frenchsquirrel.co Bisous (sharing the recipe soon — protein in the mornings is essential for hormone health & overall blood sugar balance)

